.frames = 51
.line
.col
.indexStart
.line_length = 36
.pixel_index
.frame_count
.val

start:
    LDA #0
    STA line
    LDA #0
    STA col
    LDA #$100
    STA pixel_index
    LDA #(frames)
    STA frame_count
    LDA #$7000
    STA indexStart

loop:
    LDA [pixel_index], 0
    STA val
    CMP #6969
    BEQ DrawMultiple
    @add_char val
DrawMultipleEnd:
    INC pixel_index
    LDA line
    CMP #18
    BEQ reset
    JMP loop

reset:
    DUP
    LDA #0
    STA line
    LDA #0
    STA col
    DEC frame_count
    BEQ start
    JMP loop

DrawMultiple:
.MultipleCount
    INC pixel_index
    LDA [pixel_index], 0
    STA val
    INC pixel_index
    LDA [pixel_index], 0
    STA MultipleCount
DrawMultipleLoop:
    @add_char val
    DEC MultipleCount
    BEQ DrawMultipleEnd
    JMP DrawMultipleLoop

    
~add_char 1 {
.index
    LDA ^1
    PHA
    @mul #(line_length) line
    ADD col
    ADD indexStart
    STA index
    PLA
    STA ^1
    STA [index], 0
    LDA col
    SUB #(line_length-1)
    BEQ else
    INC col
    JMP end
else:
    JSR new_line
end:
}

new_line:
    INC line
    LDA #0
    STA col
    RTS

    
sleep:
    LDA #100
sleep_loop:
    SUB #1
    BEQ sleep_end
    NOP
    JMP sleep_loop
sleep_end:
    RTS


~mul 2 {
; A, B
    LDA #0
loop_mul:
    LDX ^2
    BEQ end_mul
    ADD ^1
    DEC ^2
    JMP loop_mul
end_mul:
}

